int getMultiplications(int n,int dimensions[]){ //n为几个矩阵，dimensions为每个矩阵的维度
	int m[n+1][n+1]; //用m[i][j]的table存放Ai到Aj相乘的最小次数
	for (int i = 1; i < n+1; ++i){
		m[i][i]=0;  //只有一个矩阵时，乘法次数为0
	} 
	for (int L = 1; L < n; ++L){  //L为当前需要相乘矩阵的数量，从1开始
		for (int i = 1; i < n-L+1; ++i){
			int j = i+L;
			m[i][j]=m[i][i]+m[i+1][j]+dimensions[i-1]*dimensions[i]*dimensions[j];
			//以i为初始分界点，移动分界点后在与之比较
			for (int k = i+1; k < j; ++k){
				int temp = m[i][k]+m[k+1][j]+dimensions[i-1]*dimensions[k]*dimensions[j];
				if(temp<m[i][j]){
					m[i][j]=temp;
				}
			} 
		}
	}
	return m[1][n];
}

